import React from 'react';
import './Header.css';
import headerLogo from '../../images/header-logo.svg';
import headerProfile from '../../images/header-profile.svg'

function Header() {
  return (
    <div className='header'>
      <img className="header__logo" src={headerLogo} alt="Логотип" />
      <div className="header__user-data">
        <p className="header__user-films">Фильмы</p>
        <p className="header__user-save-films">Сохранённые фильмы</p>
      </div>
      <img className="header__profile-logo" src={headerProfile} alt="Логотип" />
    </div>
  )
}
export default Header;
